import React, { Component } from 'react';
import './input-panel.css';


class InputPanel extends Component {

    render() {
    const inputPanel = 'Write what you want ?';
    return(

        <form className = 'input-panel'>
              <input type = 'text' placeholder = {inputPanel} className = 'input-text'/>
              <button type = 'button' className = 'btn btn-outline-light' onClick = { addI}>ADD NEW</button>
        </form>
    )
}
};

export default InputPanel;
